import React from 'react'

// 假设的文章数据
const article = {
  title: 'React 的魅力',
  author: 'Jane Doe',
  content: `
    React 让创建交互式用户界面变得轻而易举。为你的应用的每一个状态设计简单的视图，在数据变化时，
    React 也能高效地更新和渲染正确的组件。声明式的视图让你的代码更加可预测，也更易于调试。
    
    通过组件化的架构，你可以将 UI 切分成独立可复用的片段，然后独立地思考每一部分。React 也可以通过
    props 来让你将富数据传递给你的组件，让状态管理与 DOM 分离，使得你的应用开发更加高效、简单。
  `
}

const HomePage = () => {
  return (
    <div className="homepage">
      <h1>{article.title}</h1>
      <p className="author">作者：{article.author}</p>
      <div className="content">{article.content}</div>
    </div>
  )
}

export default HomePage
